struct State{
	int posx;
	int posy;
	int type;				//0: Square, 1: L-piece, 2: Z-piece, 3: T-piece, 4: I-piece
	int orientation; //0,1,2 or 3
};

typedef struct State STyp;
STyp PIECE[5];

void PIECE_Init(){
	for(int i=0; i<5; i++)
	{
		PIECE[i].posx=3;
		PIECE[i].posy=0;
		PIECE[i].orientation=0;
		PIECE[i].type = i;
	}
}


void SysTick_Init(void){
	
        NVIC_ST_CTRL_R =0; //Disable SysTick during setup
        NVIC_ST_RELOAD_R = 0xFFFFFF; //maximum reload value
        NVIC_ST_CURRENT_R = 0; //any write to current clears it
        //NVIC_SYS_PRI3_R = (NVIC_SYS_PRI3_R & 0x00FFFFFF) | 0x20000000;
        NVIC_ST_CTRL_R =0x07;
}


void Screen_Init(void){
	ST7735_DrawBitmap(0,160,griddy,90,160);			//printing grid image to screen
	
	ST7735_DrawFastVLine(100,40,20,0xFFFF);			//printing score board
	ST7735_DrawFastHLine(100,40,20,0xFFFF);
	ST7735_DrawFastVLine(120,40,20,0xFFFF);
	ST7735_DrawFastHLine(100,60,20,0xFFFF);
	
	ST7735_SetCursor(16,7);
	ST7735_SetTextColor(0xFFFF);
	ST7735_OutString("pts!");
	
	ST7735_SetCursor(18,5);
	LCD_OutDec(filled_Rows);
	
}

void PortE_Init(){
	volatile int delay;
	SYSCTL_RCGCGPIO_R |=0x10;
	delay++;
	delay++;
	delay++;
	delay++;
	GPIO_PORTE_DIR_R |=0x0C;
	GPIO_PORTE_DEN_R |=0x03;
}

//This function increments the x position depending on the position of the slidepot
void IncrementPosX(){
	Position=ADC_In();
	
		if(Position>0 && Position<=490)
			PIECE[random].posx=0;
		else if(Position>490 && Position<=980)
			PIECE[random].posx=1;
		else if(Position>980 && Position<=1470)
			PIECE[random].posx=2;
		else if(Position>1470 && Position<=1960)
			PIECE[random].posx=3;
		else if(Position>1960 && Position<=2450)
			PIECE[random].posx=4;
		else if(Position>2450 && Position<=2940)
			PIECE[random].posx=5;
		else if(Position>2940 && Position<=3430)
			PIECE[random].posx=6;

		else if(Position>3430 && Position<3920)
		{
			if((PIECE[random].type==0&&(PIECE[random].orientation==0||PIECE[random].orientation==1||PIECE[random].orientation==2||PIECE[random].orientation==3)) || (PIECE[random].type==1 &&(PIECE[random].orientation==0||PIECE[random].orientation==2||PIECE[random].orientation==3)) || (PIECE[random].type==2 &&(PIECE[random].orientation==1||PIECE[random].orientation==2)) || (PIECE[random].type==3 &&(PIECE[random].orientation==1||PIECE[random].orientation==3)) || (PIECE[random].type==4 &&(PIECE[random].orientation==0||PIECE[random].orientation==2)))
				PIECE[random].posx=7;
			else 
				PIECE[random].posx=6;
		}	
		else if(Position>3920)
		{
			if(PIECE[random].type==4 &&(PIECE[random].orientation==0||PIECE[random].orientation==2))
				PIECE[random].posx=8;
			else if((PIECE[random].type==0&&(PIECE[random].orientation==0||PIECE[random].orientation==1||PIECE[random].orientation==2||PIECE[random].orientation==3)) || (PIECE[random].type==1 &&(PIECE[random].orientation==0||PIECE[random].orientation==2||PIECE[random].orientation==3)) || (PIECE[random].type==2 &&(PIECE[random].orientation==1||PIECE[random].orientation==2)) || (PIECE[random].type==3 &&(PIECE[random].orientation==1||PIECE[random].orientation==3)) )
				PIECE[random].posx=7;
			else 
				PIECE[random].posx=6;
		}	
		
}


int main(void){

	PLL_Init(Bus80MHz);       // Bus clock is 80 MHz 
	Random_Init(1);
  ADC_Init();
	Output_Init();
	PIECE_Init();
	SysTick_Init();
	Grid_Init();
	PortE_Init();
  Timer0_Init(IncrementPosX, 130000);
	Sound_Init();
	EnableInterrupts();
	
	while(1){
	
		ST7735_DrawBitmap(0,160,tetrisStartScreen,120, 160);
		
		if(exit_StartScreen==2)
		{
			exit_StartScreen=0;	//resetting exit_screen
			while(isGameOver()==0)
			{
				ST7735_FillScreen(0);
				Screen_Init();
			
				random = Random32()%5;
				DrawPiece(PIECE[random].type, PIECE[random].orientation, PIECE[random].posx, PIECE[random].posy);
				DrawGrid();
			
				while(isMovePossible(PIECE[random].posx, PIECE[random].posy+1, PIECE[random].type, PIECE[random].orientation))		//checking next position in grid
				{
					Screen_Init();
					DrawGrid();
					for(int delay=0; delay<1000; delay++){} //delay
					PIECE[random].posy = PIECE[random].posy +1;
					DrawPiece(PIECE[random].type, PIECE[random].orientation, PIECE[random].posx, PIECE[random].posy);
					for(int delay=0; delay<5000000; delay++){} //delay
				}
			
				Store_Piece(PIECE[random].posx, PIECE[random].posy, PIECE[random].type, PIECE[random].orientation);		//if piece cannot move further, store it in the grid
				DrawGrid();
				PIECE_Init(); //restoring intial state
								
				filled_Rows = DeletePossibleLines();
				for(int delay=0; delay<100; delay++); //delay
				score=score+filled_Rows;
				DrawGrid();
			}
		
			while(exit_StartScreen==0)
			{
				ST7735_DrawBitmap(0,160,gameOver,120,160);      //Print game over screen
			}
		
		}
	}
}


void SysTick_Handler()
{
	rotationKey=GPIO_PORTE_DATA_R &=0x01; //if PE0 is pressed, change orientation of piece
	for(int i=0; i<100; i++){} //debouncing switch
	rotationKey=GPIO_PORTE_DATA_R &=0x01; //if PE0 is pressed, change orientation of piece
	
	if(rotationKey==1)
	{
		if(PIECE[random].orientation==3)
			PIECE[random].orientation=0;
		else
			PIECE[random].orientation++;
	}
	
	exit_StartScreen=GPIO_PORTE_DATA_R &=0x02;	//if PE1 is pressed, start game. If PE1 is pressed again, exit game;
	for(int delay=0; delay<100; delay++){}						//debouncing switch
	exit_StartScreen=GPIO_PORTE_DATA_R &=0x02;	//if PE1 is pressed, start game. If PE1 is pressed again, exit game;
}

